import { useState } from "react";
import FilesInDisplay from "./FilesInDisplay";
import InputControl from "./InputControl";
import { Form } from "react-bootstrap";
import PropTypes from "prop-types";
import UserInputControl from "./UserInputControl";
const LibraryModal = ({ onSubmit, page }) => {
  const [currentPage, setCurrentPage] = useState(1);
  // const [nextPage, setNetPage] = useState(2);
  // const [previousPage, setPreviousPage] = useState();

  function nextPage() {
    if (currentPage + 1 < 3) {
      setCurrentPage(currentPage + 1);
    }
  }
  function previousPage() {
    if (currentPage - 1 > 0) {
      setCurrentPage(currentPage - 1);
    }
  }

  LibraryModal.prototype = {
    onSubmit: PropTypes.fun,
  };

  return (
    <>
      <h3> My Wizard</h3>
      <p>heyo</p>
      <div>
        {currentPage === 1 && <FilesInDisplay onSubmit={nextPage} />}
        {currentPage === 2 && (
          <UserInputControl
            id="uder-details"
            onSubmit={nextPage}
            previousPage={previousPage}
          />
        )}
      </div>
    </>
  );
};

export default LibraryModal;
